import React, { Component } from 'react' 
import { BrowserRouter, Route, NavLink } from 'react-router-dom';


class CreateProduct extends Component {

    render () {
        return (
            <div> Create Product </div>
        );
    }
}

class AddMaterial extends Component {

    render () {
        return (
            <div> Add Material </div>
        );
    }
}


class AddProduct extends Component {

    render() {
        return(
            <BrowserRouter>
            <div className="product-form-container">
               <div className="side-nav"> 
                    <ul className='mini-nav-list'>
                        <li className="link-item"><NavLink to="/add-product/create">+ADD PRODUCT</NavLink> </li>
                        <li className="link-item"> <NavLink to="/add-product/create">+ADD SPECS</NavLink></li>
                    </ul>
                </div>
                <div className="main-content">

                </div>
            </div>

            <Route path="/add-product/create" exact component={CreateProduct} />
            <Route path="/add-product/add-material" exact component={AddMaterial} />     
            </BrowserRouter>
        );
    }
}

export default AddProduct
